import React from "react";
import "../styles.css";
import Navbar from "../components/Navbar";

const Home = () => {
  return (
    <>
      <Navbar />
      <section id="intro">
        <img src={process.env} alt="" />
      </section>
    </>
  );
};

export default Home;
